// export default Navbar;


import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary shadow-sm py-3 px-3 px-lg-5">
      {/* Brand */}
      <Link to="/" className="navbar-brand d-flex d-lg-none">
        <h1 className="m-0 display-4 text-secondary">
          <span className="text-white">Farm</span>Fresh
        </h1>
      </Link>

      {/* Toggler */}
      <button
        className="navbar-toggler"
        type="button"
        data-bs-toggle="collapse"
        data-bs-target="#navbarCollapse"
        aria-controls="navbarCollapse"
        aria-expanded="false"
        aria-label="Toggle navigation"
      >
        <span className="navbar-toggler-icon"></span>
      </button>

      {/* Nav Links */}
      <div className="collapse navbar-collapse" id="navbarCollapse">
        <div className="navbar-nav mx-auto py-0">
          <Link to="/" className="nav-item nav-link active">Home</Link>
          <Link to="/login" className="nav-item nav-link">Login</Link>
          <Link to="/register" className="nav-item nav-link">Register</Link>
          <Link to="/contact" className="nav-item nav-link">Contact</Link>
          <a
            href="https://rzp.io/l/wSXTA0m"
            target="_blank"
            rel="noopener noreferrer"
            className="nav-item nav-link"
          >
            Donate
          </a>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
